import App from "./App";

const Dashboard = ({ campaigns }) => {
  return (
    <div>
      <h2>Ad Campaign Dashboard</h2>
      {campaigns.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Campaign Name</th>
              <th>Clicks</th>
              <th>Impressions</th>
              <th>Spend</th>
              <th>Conversions</th>
            </tr>
          </thead>
          <tbody>
            {campaigns.map((campaign) => (
              <tr key={campaign.campaign_id}>
                <td>{campaign.date}</td>
                <td>{campaign.campaign_name}</td>
                <td>{campaign.clicks}</td>
                <td>{campaign.impressions}</td>
                <td>{campaign.spend}</td>
                <td>{campaign.conversions}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No campaigns data available</p>
      )}
    </div>
  );
};

export default Dashboard;
